
public class LogicalOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		int b=11;
		int c=12;
		int d=13;
		boolean res=(a<b && c<d);
		boolean res1=(a>b || c<d);
		System.out.println(res);
		System.out.println(res1);
		System.out.println(!res);

	}

}